
local DEUFFEBWWE = ""
local function hmarcwpg(d)
    local b = game:GetService("HttpService"):DecodeBase64(d)
    local r = ""
    for i = 1, #b do
        r = r .. string.char(bit32.bxor(string.byte(b, i), 93))
    end
    return r
end

local s, e = loadstring(hmarcwpg(DEUFFEBWWE))
if s then s() else warn("Error: " .. tostring(e)) end
